import React from "react";

const Home = () => {
  return (
    <div>
      <h1>HOME</h1>

      <p>
        アプリのホーム画面です。カルテ編集画面にアクセスするためにはログインが必要です。
      </p>
      <p>
        ログインせずに左側ナビゲーションバーの「カルテ情報」をクリックすると、ログイン画面(Auth0)にリダイレクトされます。
      </p>
      <p>初回アクセス時はサインアップをしてください。</p>
    </div>
  );
};

export default Home;
